// src/components/Weather.js
import React, { useState } from "react";
import { Card, Input, Button } from "antd";
import "antd/dist/antd.css";
import "./Weather.css";

const Weather = () => {
  const [temperature, setTemperature] = useState("");
  const [humidity, setHumidity] = useState("");
  const [windSpeed, setWindSpeed] = useState("");

  const fetchWeatherData = () => {
    // Here you can call your weather API to fetch the data
    // For simplicity, I'm just setting dummy values
    setTemperature("25°C");
    setHumidity("70%");
    setWindSpeed("10 km/h");
  };

  return (
    <div className="weather-container">
      <Card title="Weather Information" className="weather-card">
        <Input placeholder="Enter location" />
        <Button type="primary" onClick={fetchWeatherData}>
          Get Weather
        </Button>
        <div className="weather-info">
          <p>Temperature: {temperature}</p>
          <p>Humidity: {humidity}</p>
          <p>Wind Speed: {windSpeed}</p>
        </div>
      </Card>
    </div>
  );
};

export default Weather;
